#include "count_sort.cpp"

TEST(count_sort, null)
{
    vector<int> array = {};
    vector<int> res =   {};
    count_sort(array);
    ASSERT_EQ(array,  res);
}

TEST(count_sort, single)
{
    vector<int> array = {1};
    vector<int> res =   {1};
    count_sort(array);
    ASSERT_EQ(array,  res);
}

TEST(count_sort, presorted)
{
    vector<int> array = {1, 2, 3, 4};
    vector<int> res =   {1, 2, 3, 4};
    count_sort(array);
    ASSERT_EQ(array,  res);
}

TEST(count_sort, reversed_odd)
{
    vector<int> array = {5, 4, 3, 2, 1};
    vector<int> res =   {1, 2, 3, 4, 5};
    count_sort(array);
    ASSERT_EQ(array,  res);
}

TEST(count_sort, reserved_even)
{
    vector<int> array = {4, 3, 2, 1};
    vector<int> res =   {1, 2, 3, 4};
    count_sort(array);
    ASSERT_EQ(array,  res);
}

TEST(count_sort, random)
{
    vector<int> array = {input};
    vector<int> res =   {result};
    count_sort(array);
    ASSERT_EQ(array,  res);
}


